import React,{useState} from "react";

const AddNew = () => {
  const [data, setData] = useState("");

  return (
    <div>
      {console.log(data)}
      <div style={{ display: "flex", width: "100%" }}>
        <div style={{ display: "grid", gridTemplateColumns: "50% 50%" }}>
          <div style={{ display: "flex" }}>
            <p style={{ paddingRight: "5px", fontWeight: "bold" }}>NAME:</p>
            <p
              style={{
                paddingRight: "30px",
                wordBreak: "break-word",
              }}
            >
              NAME
            </p>
          </div>
          <div style={{ display: "flex" }}>
            <div
            >
              {viewData[0].Domain_Status}
            </div>
            <div
              style={{
                marginTop: "0px",
                paddingTop: "0px",
                marginLeft: "50px",
              }}
            >
              <p
                style={{
                  textAlign: "center",
                  marginRight: "20px",
                  marginBottom: "5px",
                  fontWeight: "bold",
                }}
              >
                DA
              </p>
              <p
                style={{
                  marginRight: "20px",
                  border: "1px solid grey",
                  padding: "5px",
                  borderRadius: "5px",
                }}
              >
                DA
              </p>
            </div>
            <div style={{ marginTop: "0px", paddingTop: "0px" }}>
              <p
                style={{
                  textAlign: "center",
                  marginRight: "20px",
                  marginBottom: "5px",
                  fontWeight: "bold",
                }}
              >
                DR
              </p>
              <p
                style={{
                  marginRight: "20px",
                  border: "1px solid grey",
                  padding: "5px",
                  borderRadius: "5px",
                }}
              >
                {viewData[0].Domain_DR}
              </p>
            </div>
          </div>
        </div>
      </div>
      <div style={{ display: "grid", gridTemplateColumns: "50% 50%" }}>
        <div style={{ display: "flex" }}>
          <div style={{ width: "100%", marginRight: "10px" }}>
            <p style={{ fontWeight: "bold" }}>URL:</p>
            <p
              style={{
                padding: "5px",
                border: "1px solid grey",
                borderRadius: "5px",
              }}
            >
              {viewData[0].Domain_URL}
            </p>
          </div>
          <div style={{ width: "100%" }}>
            <p style={{ fontWeight: "bold" }}>Quality</p>
            <p
              style={{
                padding: "5px",
                border: "1px solid grey",
                borderRadius: "5px",
              }}
            >
              {viewData[0].Domain_Quality}
            </p>
          </div>
        </div>
      </div>
      <div style={{}}>
        <p style={{ fontWeight: "bold" }}>Link Samples</p>
        <div>
          <p
            style={{
              padding: "5px",
              border: "1px solid grey",
              borderRadius: "5px",
            }}
          >
            {viewData[0].Domain_Link_SampleA}
          </p>
          <p
            style={{
              padding: "5px",
              border: "1px solid grey",
              borderRadius: "5px",
            }}
          >
            {viewData[0].Domain_Link_SampleB}
          </p>
          <p
            style={{
              padding: "5px",
              border: "1px solid grey",
              borderRadius: "5px",
            }}
          >
            {viewData[0].Domain_Link_SampleC}
          </p>
          <p
            style={{
              padding: "5px",
              border: "1px solid grey",
              borderRadius: "5px",
            }}
          >
            {viewData[0].Domain_Link_SampleD}
          </p>
          <p
            style={{
              padding: "5px",
              border: "1px solid grey",
              borderRadius: "5px",
            }}
          >
            {viewData[0].Domain_Link_SampleE}
          </p>
          <p
            style={{
              padding: "5px",
              border: "1px solid grey",
              borderRadius: "5px",
            }}
          >
            {viewData[0].Domain_Link_SampleF}
          </p>
          <p
            style={{
              padding: "5px",
              border: "1px solid grey",
              borderRadius: "5px",
            }}
          >
            {viewData[0].Domain_Link_SampleG}
          </p>
          <p
            style={{
              padding: "5px",
              border: "1px solid grey",
              borderRadius: "5px",
            }}
          >
            {viewData[0].Domain_Link_SampleH}
          </p>
          <p
            style={{
              padding: "5px",
              border: "1px solid grey",
              borderRadius: "5px",
            }}
          >
            {viewData[0].Domain_Link_SampleI}
          </p>
          <p
            style={{
              padding: "5px",
              border: "1px solid grey",
              borderRadius: "5px",
            }}
          >
            {viewData[0].Domain_Link_SampleJ}
          </p>
        </div>
      </div>
      <div>
        <p style={{ fontWeight: "bold" }}>Domain Comments</p>
        <p
          style={{
            padding: "5px",
            border: "1px solid grey",
            borderRadius: "5px",
          }}
        >
          {viewData[0].Domain_Comments}
        </p>
      </div>
      <div
        style={{
          display: "flex",
          justifyContent: "space-evenly",
          alignItems: "center",
        }}
      >
        <div>
          <p style={{ fontWeight: "bold" }}>Link Type</p>
          <p
            style={{
              padding: "5px",
              border: "1px solid grey",
              borderRadius: "5px",
              textAlign: "center",
            }}
          >
            {viewData[0].Domain_Link_Type}
          </p>
        </div>
        <div>
          <p style={{ fontWeight: "bold" }}>Link Attribute</p>
          <p
            style={{
              padding: "5px",
              border: "1px solid grey",
              borderRadius: "5px",
              textAlign: "center",
            }}
          >
            {viewData[0].Domain_Link_Attribute}
          </p>
        </div>
        <div>
          <p style={{ fontWeight: "bold" }}>Ref Domains</p>
          <p
            style={{
              padding: "5px",
              border: "1px solid grey",
              borderRadius: "5px",
              textAlign: "center",
            }}
          >
            {viewData[0].Domain_RefDomCount}
          </p>
        </div>
      </div>
      <div style={{ marginBottom: "50px" }}>
        <p style={{ fontWeight: "bold" }}>Industry</p>
        <p
          style={{
            padding: "5px",
            border: "1px solid grey",
            borderRadius: "5px",
          }}
        >
          {viewData[0].Domain_Industry}
        </p>
      </div>
      <h2>Traffic Details</h2>
      <div>
        <p style={{ fontWeight: "bold" }}>Traffic Country</p>
        <p
          style={{
            padding: "5px",
            border: "1px solid grey",
            borderRadius: "5px",
            width: "fit-content",
          }}
        >
          {viewData[0].Domain_traffic_Country}
        </p>
      </div>
      <div style={{ display: "flex" }}>
        <div style={{ paddingLeft: "50px" }}>
          <p style={{ fontWeight: "bold" }}>SEMRUSH Traffic</p>
          <p
            style={{
              padding: "5px",
              border: "1px solid grey",
              borderRadius: "5px",
            }}
          >
            {viewData[0].Domain_SEMRush}
          </p>
        </div>
        <div style={{ paddingLeft: "50px" }}>
          <p style={{ fontWeight: "bold" }}>AHREF Traffic</p>
          <p
            style={{
              padding: "5px",
              border: "1px solid grey",
              borderRadius: "5px",
            }}
          >
            {viewData[0].Domain_AHRef}
          </p>
        </div>
      </div>
      <h2 style={{ marginTop: "50px" }}>Cost Details</h2>
      <div style={{ display: "flex", justifyContent: "space-evenly" }}>
        <div>
          <p style={{ fontWeight: "bold" }}>Currency</p>
          <p
            style={{
              padding: "5px",
              border: "1px solid grey",
              borderRadius: "5px",
            }}
          >
            {viewData[0].Domain_Currency}
          </p>
        </div>
        <div>
          <p style={{ fontWeight: "bold" }}>Original</p>
          <p
            style={{
              padding: "5px",
              border: "1px solid grey",
              borderRadius: "5px",
            }}
          >
            {viewData[0].Domain_Cost_Original}
          </p>
        </div>
        <div>
          <p style={{ fontWeight: "bold" }}>Negotiated</p>
          <p
            style={{
              padding: "5px",
              border: "1px solid grey",
              borderRadius: "5px",
            }}
          >
            {viewData[0].Domain_Cost_Nego}
          </p>
        </div>
      </div>
      <div style={{ width: "fit-content" }}>
        <p style={{ fontWeight: "bold" }}>Office Country</p>
        <p
          style={{
            padding: "5px",
            border: "1px solid grey",
            borderRadius: "5px",
            width: "fit-content",
          }}
        >
          {viewData[0].Domain_Office_Country}
        </p>
      </div>
      <div>
        <p style={{ fontWeight: "bold" }}>Cost Comments</p>
        <p
          style={{
            padding: "5px",
            border: "1px solid grey",
            borderRadius: "5px",
          }}
        >
          {viewData[0].Domain_Cost_Comments}
        </p>
      </div>
      <h2 style={{ marginTop: "50px" }}>Contact Details</h2>
      <div>
        <p style={{ fontWeight: "bold" }}>Name</p>
        <p
          style={{
            padding: "5px",
            border: "1px solid grey",
            borderRadius: "5px",
            width: "fit-content",
          }}
        >
          {viewData[0].Domain_Contact_Person}
        </p>
      </div>
      <div>
        <p style={{ fontWeight: "bold" }}>Email</p>
        <p
          style={{
            padding: "5px",
            border: "1px solid grey",
            borderRadius: "5px",
            width: "fit-content",
          }}
        >
          {viewData[0].Domain_Contact_EmailA}
        </p>
        <p
          style={{
            padding: "5px",
            border: "1px solid grey",
            borderRadius: "5px",
            width: "fit-content",
          }}
        >
          {viewData[0].Domain_Contact_EmailB}
        </p>
        <p
          style={{
            padding: "5px",
            border: "1px solid grey",
            borderRadius: "5px",
            width: "fit-content",
          }}
        >
          {viewData[0].Domain_Contact_EmailC === null
            ? "N/A"
            : viewData[0].Domain_Contact_EmailC}
        </p>
      </div>
      <div>
        <p style={{ fontWeight: "bold" }}>Phone</p>
        <p
          style={{
            padding: "5px",
            border: "1px solid grey",
            borderRadius: "5px",
            width: "fit-content",
          }}
        >
          {viewData[0].Domain_Contact_Phone === null
            ? "N/A"
            : viewData[0].Domain_Contact_Phone}
        </p>
      </div>
      <h2 style={{ marginTop: "50px" }}>Time Details</h2>
      <div>
        <p style={{ fontWeight: "bold" }}>Time of Creation</p>
        <div
          style={{
            display: "flex",
            border: "1px solid grey",
            borderRadius: "5px",
            paddingTop: "8px",
            width: "fit-content",
          }}
        >
          <p style={{ marginRight: "10px" }}>
            {viewData[0].Creation_Date.split(".")[0].split("T")[0]}
          </p>
          <p>{viewData[0].Creation_Date.split(".")[0].split("T")[1]}</p>
        </div>
        <p style={{ fontWeight: "bold", marginTop: "10px" }}>
          Time of Updation
        </p>
        <div
          style={{
            display: "flex",
            border: "1px solid grey",
            borderRadius: "5px",
            paddingTop: "8px",
            width: "fit-content",
          }}
        >
          <p style={{ marginRight: "10px" }}>
            {viewData[0].Updation_Date.split(".")[0].split("T")[0]}
          </p>
          <p>{viewData[0].Updation_Date.split(".")[0].split("T")[1]}</p>
        </div>
      </div>
    </div>
  );
};
export default AddNew;
